import React from 'react';
import s from './Navbar.css';

import { BrowserRouter,  NavLink } from 'react-router-dom';
import { ReactComponent as LogoLeagues } from '../../img/league.png';
import { ReactComponent as LogoTeams } from '../../img/teams.png';
import { ReactComponent as LogoSchedule } from '../../img/schedule.png';


const ListItem = ({ item }) => (
  <div>
  <NavLink path={item.href} component={item.component}>
   {item.title}
  </NavLink>
  </div>
);


const Navbar = (props) => {
  const href="/leagues/"+props.period
	return(
    <div className={s.hamburger_menu}>
      <input id="menu__toggle" type="checkbox" />
      <label className="menu__btn" for="menu__toggle">
        <span></span>
      </label>
    <ul className="menu__box">
      <li><a className="menu__item" href={href}>Лиги</a></li>
      <li><a className="menu__item" href="/leagueSchedule">Расписание лиги</a></li>
      <li><a className="menu__item" href="/teams">Команды</a></li>
      <li><a className="menu__item" href="/teamSchedule">Расписание команды</a></li>
    </ul>
	
    </div>)
}

export default Navbar;
